  false,\n\t\"url\": null,\n\t\"notes\": \"Fish survey, fishing duration, and other
  data were collected from net trawls from the NORTH PACIFIC from 25 April 1975 to
  07 August 1975. Data were collected by the University of Alaska - Fairbanks; Institute
  of Marine Science (UAK/IMS) as part of Outer Continental Shelf Environmental Assessment
  Program (OCSEAP). Data were processed by NODC to the NODC standard F123 Fish/Shellfish
  Surveys format. Full format descriptions are available from the NODC homepage at
  www.nodc.noaa.gov/. An analog file for this accession is located at NODC in Silver
  Spring, MD.nnThe F123 format is used for data from field sampling of marine fish
  and shellfish. The data derive from analysis of midwater or bottom tow catches and
  provide information on population density and distribution. Cruise information,
  position, date, time, gear type, fishing distance and duration, and number of hauls
  are reported for each survey. Environmental data may include meteorological conditions,
  surface and bottom temperature and salinity, and current direction and speed. Bottom
  trawl or other gear dimensions and characteristics are also reported. Catch statistics
  (e.g., weight, volume, number of fish per unit volume) may be reported for both
  total haul and for individual species. Biological characteristics of selected specimens,
  predator/ prey information (from stomach contents analysis), and growth data may
  also be included. A text record is available for comments.\",\n\t\"owner_org\":
